pragma solidity ^0.4.24;

import 'openzeppelin-solidity/contracts/token/ERC20/MintableToken.sol';
import 'openzeppelin-solidity/contracts/token/ERC20/BurnableToken.sol';
import 'openzeppelin-solidity/contracts/access/Whitelist.sol';
import './SotuuProjectManger.sol';
import './MoveTokenRequestLogger.sol';

contract SotuuToken is MintableToken, BurnableToken, Whitelist {

  event DepositAndVoted( address _destination, uint256 _value, bool _flg );

  string public name;
  string public symbol;
  uint8 public decimals;

  constructor(
    string _name,
    string _symbol,
    uint8 _decimals
  ) public {
    name = _name;
    symbol = _symbol;
    decimals = _decimals;
  }

  bool public debugFlg = true;

  /**
   * @dev Throws if called by any account other than the oracle.
   */
  address public oracle;
  modifier onlyOracle() {
    if (debugFlg == true) {
      _;
      return;
    }
    require(msg.sender == oracle);
    _;
  }

  /**
   * @dev deposit stake and vote
   * @param _destination address of data project manager contract
   * @param _proof proof of data
   * @param _approveFlg true or false
   */
  function depositAndVote(
      address _destination,
      bytes32 _proof,
      bool _approveFlg
      ) public {

    if (debugFlg == false) {
      if (whitelist(_destination) == false) revert();
    }

    uint256 reward = SotuuProjectManger(_destination).getValidationReward();

    // transfer value
    transfer( _destination, reward );

    if (_destination.call.gas(1000000)(bytes4(keccak256("vote(address,bytes32,bool)")), msg.sender, _proof, _approveFlg) != true) {
      revert();
    }

    emit DepositAndVoted( _destination, reward, _approveFlg );
  }

  /**
   * @dev mint token after checking record called by oracle
   * @param _destination address of logger contract
   * @param _requestId issued on old network
   * @param _recipient address of recipient
   * @param _amount amount of token mint
   */
  function mintAndRecord(
    address _destination,
    bytes20 _requestId,
    address _recipient,
    uint256 _amount
  ) onlyOracle canMint public {

    if ( _destination.call.gas(600000)(bytes4(keccak256("recordMintRequest(bytes20)")), _requestId) != true ) {
      revert();
    }

    // only owner can call mint methods
    // mint(_recipient, _amount);
    totalSupply_ = totalSupply_.add(_amount);
    balances[_recipient] = balances[_recipient].add(_amount);
    emit Mint(_recipient, _amount);
    emit Transfer(address(0), _recipient, _amount);
  }

  /**
   * @dev deposit and request token from current network to another.
   * @param _destination address of logger contract
   * @param _value amount of token
   */
  function moveTokenRequest (
    address _destination,
    uint256 _value
  )  onlyOracle public {
    transfer( _destination, _value );
    // 100000 was too small
    if ( _destination.call.gas(600000)(bytes4(keccak256("submitMoveRequest(address,uint256)")), msg.sender, _value) != true ) {
      revert();
    }
  }


  /**
  * @dev set oracle address
  * @param _address address
  */
  function setOracle (address _address) onlyOwner public returns (bool _success) {
    oracle = _address;
  }

  /**
   * @dev set debug flg
   * @param _flg true is debugging. false is production
   */
  function setDebugFlg (bool _flg) onlyOwner public returns (bool _success) {
    debugFlg = _flg;
    return true;
  }
}

